[[package]]
name = "botocore"
version = "1.24.21"
description = "Low-level, data-driven core of boto 3."
category = "main"
optional = true
python-versions = ">= 3.6"

[package.dependencies]
jmespath = ">=0.7.1,<2.0.0"
python-dateutil = ">=2.1,<3.0.0"
urllib3 = ">=1.25.4,<1.27"

[package.extras]
crt = ["awscrt (==0.13.5)"]

[[package]]
name = "botocore-stubs"
version = "1.25.3"
description = "Type annotations for botocore 1.25.3 generated with mypy-boto3-builder 7.5.9"
category = "dev"
optional = false
python-versions = ">=3.6"

[package.dependencies]
typing-extensions = ">=4.1.0"

[[package]]
name = "brotli"
version = "1.0.9"
description = "Python bindings for the Brotli compression library"
category = "main"
optional = true
python-versions = "*"

[[package]]
name = "cchardet"
version = "2.1.7"
description = "cChardet is high speed universal character encoding detector."
category = "main"
